import Home from "~/Pages/Home/home";
import Following from "~/Pages/Following/following";
import Upload from "~/Pages/upload/upload";
// public router
const publicRouter = [
  {
    path: "/",
    component: Home,
  },
  {
    path: "/following",
    component: Following,
  },
  {
    path: "/upload",
    component: Upload,
    layout:null
  },
];
const privateRouter = [];
export {publicRouter, privateRouter};
